`define extra_bits (((6*op_width>256)?((6*op_width>4096)?((6*op_width>16384)?((6*op_width>32768)?16:15):((6*op_width>8192)?14:13)):((6*op_width>1024)?((6*op_width>2048)?12:11):((6*op_width>512)?10:9))):((6*op_width>16)?((6*op_width>64)?((6*op_width>128)?8:7):((6*op_width>32)?6:5)):((6*op_width>4)?((6*op_width>8)?4:3):((6*op_width>2)?2:1))))+100)

  reg [op_width+`extra_bits-1:0] w;
  reg [2*(op_width+`extra_bits)-1:0] w_sqr;

  always @ (a)
  begin
    w = {$unsigned(a),{`extra_bits{1'b0}}};
    result = 0;
    for (i=1; i<=op_width; i=i+1)
    begin
      w_sqr = w * w;
      if (w_sqr[2*(op_width+`extra_bits)-1] === 1)
        begin
          result = (result << 1) | 1;
	  w = w_sqr[2*(op_width+`extra_bits)-1:(op_width+`extra_bits)];
        end
      else
        begin
          result = result << 1;
	  w = w_sqr[2*(op_width+`extra_bits)-2:(op_width+`extra_bits)-1];
        end
    end
    w_sqr = w * w;
    if (w_sqr[2*(op_width+`extra_bits)-1] === 1)
      result = result + 1;
  end
`undef extra_bits

