      p2_q_new = ($signed(Q2_trunc_new) * $signed({1'b0,short_a}) + $signed(Q1_trunc_new) * $signed({2'b01,{op_width-1{1'b0}}})) >>> (op_width-1);
      p1_q_new = $signed(p2_q_new) * $signed({1'b0,short_a}) + $signed(Q0_trunc_new) * $signed({2'b01,{op_width-1{1'b0}}});   
