`undef table_addrsize
`undef coef_max_size
`undef int_bits
`undef extra_LSBs
`undef bits
`undef coef3_size
`undef coef2_size
`undef coef1_size
`undef coef0_size
`undef prod3_MSB
`undef prod2_MSB
`undef prod1_MSB
`undef z_int_size
`undef chain
`undef z_round_MSB
